import img01 from '../../assets/images/img01.png';
 
import { Link} from 'react-router-dom';

import Descripcion from "../../components/Descripcion/Descripcion";


let lugar = [
    {
        texto: 'Las pruebas de Usabilidad se centraron en evaluar la experiencia, áreas de oportunidad y buenas prácticas de la iniciativa de pago de servicios por la aplicación móvil de banco.',
        tiempo: 'Prueba de Usabilidad',        
    },
];

export default function Formularioinfo() {
    return (
        <div>
            <div className="container my-3">
            <h1 className="titulo2">Telefonía Móvil</h1>
                <div className="col-sm">
                    <div className="lugar">
                        {lugar.map((descripcion, index) => {
                            return (
                                <Descripcion
                                    key={index}                                                                      texto={descripcion.texto}
                                    tiempo={descripcion.tiempo}
                                    precio={descripcion.precio}
                                    costo={descripcion.costo}
                                >
                                </Descripcion>
                            );
                        })}
                    </div>                    
                </div>

               
                

            </div>
       




          
                    
    





            <div className="container my-3">
                <div className="row">
                    <div className="col-sm my-3">
                        <Link to="/">   <button className="btn btn-primary"> Volver al menú</button></Link>
                    </div>
                    <div className="col-sm my-3">
                        <Link to="/UX/UI">   <button className="btn btn-primary"> Siguiente</button></Link>
                       
                    </div>
                </div>
            </div>
             
          
            
        </div>
    );

}
